import React from "react";

function User(props) {
    return <th>{props.value}</th>
}

class UsersRow extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: ['Arina', 'Max', 'Sonya']
        }
        this.handleAddUser = this.handleAddUser.bind(this);
    }

    handleAddUser(e) {
        this.setState(prevState => {prevState.users.push(e.target.value)})
        if (e.keyCode === 13) {
            e.preventDefault(); // ?
            console.log('ekkkkek')
        }

    }

    render() {
        return (
            <tr>
                {this.state.users.map(user => <User key={user.toString()} value={user}/>)}
                {/*<input type="text" onSubmit={this.handleAddUser}/>*/}
            </tr>
        );
    }
}

export default UsersRow;
